$(function(){var d=$("#hidden-file-folder").val();var a="/admin/file-upload/"+d+"/null";if($("#hidden-max-files").size()>0){var c=$("#hidden-max-files").val();a+="/"+c}else{a+="/null"}if($("#hidden-settings").size()>0){var b=$("#hidden-settings").val();a+="/"+b}else{a+="/null"}$("#fileupload").fileupload({url:a});if(window.location.hostname==="blueimp.github.io"){$("#fileupload").fileupload("option",{url:"//jquery-file-upload.appspot.com/",disableImageResize:/Android(?!.*Chrome)|Opera/.test(window.navigator.userAgent),maxFileSize:5000000,acceptFileTypes:/(\.|\/)(gif|jpe?g|png|GIF|JPE?G|PNG)$/i});if($.support.cors){$.ajax({url:"//jquery-file-upload.appspot.com/",type:"HEAD"}).fail(function(){$('<span class="alert alert-error"/>').text("Upload server currently unavailable - "+new Date()).appendTo("#fileupload")})}}else{$("#fileupload").addClass("fileupload-processing");$.ajax({url:$("#fileupload").fileupload("option","url"),dataType:"json",context:$("#fileupload")[0]}).always(function(){$(this).removeClass("fileupload-processing")}).done(function(e){$(this).fileupload("option","done").call(this,null,{result:e})})}});